import{_ as e,c as o,o as a,ah as n}from"./chunks/framework.PvdZnrZd.js";const d=JSON.parse('{"title":"AUSTRALIA POST SHIPPING","description":"AUSTRALIA POST SHIPPING","frontmatter":{"title":"AUSTRALIA POST SHIPPING","description":"AUSTRALIA POST SHIPPING","date":"2025-07-18T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/featured-app/shipping/australia-post-shipping.md","filePath":"zenith/featured-app/shipping/australia-post-shipping.md"}'),i={name:"zenith/featured-app/shipping/australia-post-shipping.md"};function l(r,t,s,p,g,h){return a(),o("div",null,[...t[0]||(t[0]=[n('<h2 id="initiation" tabindex="-1">Initiation <a class="header-anchor" href="#initiation" aria-label="Permalink to &quot;Initiation&quot;">​</a></h2><p>Australia Post, a government-owned corporation known to provide postal services in Australia. Now, we have integrated it with the <strong><a href="/zenith/introduction/">Multi-vendor Marketplace app</a></strong> for Shopify.</p><p>Presenting Australia Post Feature app using which admin can allow the sellers to deliver their shipment via <strong>Australia Post shipment method</strong> and can also <strong>Generate Shipping Labels</strong> from the app.</p><p><strong>Please Note</strong>:- “Australia Post Shipping Feature is available only in the Multivendor <strong>PRO</strong> ($60/month) Plan <strong>+</strong> You need to enable the “Shipping” Feature App which is <strong>FREE</strong> of cost.”</p><p>This feature will have an additional charge of USD 10 per month over and above your current multivendor plan.</p><p>Note:- To make Australia Post shipping feature work, you need to choose the Shopify store plan that supports the <strong>“Real-Time Carrier-Calculated Shipping”.</strong></p><p>MARK:- Before enabling this feature app, please make sure that you have Australia Post credentials.</p><p>AUSTRALIA POST SHIPPING FEATURE APP IS AVAILABLE ONLY FOR <strong>FULFILLMENT</strong>.</p><h3 id="features" tabindex="-1">Features <a class="header-anchor" href="#features" aria-label="Permalink to &quot;Features&quot;">​</a></h3><ul><li>Allow sellers to ship items via Australia Post.</li><li>Generate shipping label for the fulfilled orders.</li><li>Admin needs to have an account on Australia Post Centre.</li><li>Deliver Shipment via Australia Post shipping method.</li><li>Also, allow sellers to Print Shipping Labels on their own.</li></ul><p><strong>Note</strong>:- In the case of International Shipping, currently the following countries are supported in the multi-vendor marketplace app:</p><ul><li>The United States.</li><li>China</li><li>New Zealand.</li><li>The United Kingdom.</li></ul><h3 id="admin-end" tabindex="-1">ADMIN END <a class="header-anchor" href="#admin-end" aria-label="Permalink to &quot;ADMIN END&quot;">​</a></h3><h2 id="installation" tabindex="-1">Installation <a class="header-anchor" href="#installation" aria-label="Permalink to &quot;Installation&quot;">​</a></h2><p>In order to install this feature app to your store, you need to follow some simple steps. Have a look:</p><ul><li>Multi-Vendor <strong>Admin</strong> <strong>Panel</strong>.</li><li>Go to <strong>Feature Apps</strong> section.</li><li>Search for <strong>Australia Post</strong>.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/featuredapps.webp" alt="Dashboard Admin-Multivendor Australia Post"></p><ul><li>Click the &quot;<strong>Enable</strong>&quot; button.</li><li>Now, agree with the charge of USD 10 per month by clicking the &quot;<strong>Agree&quot;</strong> button.</li><li>Click the &quot;<strong>Approve Charges</strong>&quot; button.</li></ul><p>So, that is how you can install the Australia Post feature app to the multivendor app. Let&#39;s proceed to know how to configure the feature app.</p><h3 id="configuration" tabindex="-1">Configuration <a class="header-anchor" href="#configuration" aria-label="Permalink to &quot;Configuration&quot;">​</a></h3><p>As soon as you activate the Australia Post feature app, a new sub-menu gets added to the &quot;<strong>Configuration</strong>&quot; menu of the multi-vendor app i.e. <strong>Australia Post Configuration</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/australiapostconfig.webp" alt="Dashboard Admin (1) Multivendor Australia Post"></p><p>Visiting this section, first You will be asked to enable the Australia Post shipping from the <strong>Shipping Configuration</strong> menu of the app. Then only, you will get the option to add details related to Australia Post shipping.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/04/Screenshot-2-1.png" alt="Configure australia post Multivendor Australia Post"></p><p><strong>OR</strong> You can directly visit the Shipping Configuration section and enable the Australia Post shipping method.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/04/Screenshot-2.png" alt="Screenshot"></p><p>In the Shipping Configuration menu, You will get the <strong>Australia Post shipping</strong> Option. <strong>Enable</strong> it and <strong>Save</strong> the settings.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/04/Configuration-Admin-3.png" alt="Configuration Admin-Multivendor Australia Post"></p><p>Now, admin can enable the Australia Post shipping separately for each seller from &quot;<strong>Edit Seller</strong>&quot; section of the app.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/selleradmin.webp" alt="Seller Admin-Multivendor Australia Post"></p><p>From the Edit Seller section, You can enable &quot;Australia Post Shipping feature&quot; for Your sellers.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/selleradmintwo.webp" alt="Edit Seller Admin-Multivendor Australia Post"></p><p>Now, once the shipping method is enabled, You can set this shipping as &quot;Default&quot;. Also, You can anytime disable the Australia Post shipping method for your seller.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/setasdefault.webp" alt="set as default"></p><h3 id="australia-post-configuration" tabindex="-1"><strong>Australia Post Configuration</strong> <a class="header-anchor" href="#australia-post-configuration" aria-label="Permalink to &quot;**Australia Post Configuration**&quot;">​</a></h3><p>As soon as You enable this shipping method, You will get the option to configure the Australia Post shipping details in the <strong>Australia Post Configuration</strong> Section of the app.</p><p>Here, You need to fill the details such as Australia Post API Key, API Password and the Account Number.</p><p>To get these details, You need to <strong>get registered on Australia Post Centre</strong> by <a href="https://developers.auspost.com.au/register?_ga=2.96929055.184246743.1555324571-1843766475.1555324571" target="_blank" rel="noreferrer">creating an account</a> on it.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/apconfig.webp" alt="Australia Post Configure details-Multivendor Australia Post"></p><h3 id="how-to-get-the-api-key" tabindex="-1">How To Get The API Key <a class="header-anchor" href="#how-to-get-the-api-key" aria-label="Permalink to &quot;How To Get The API Key&quot;">​</a></h3><p><strong>Step 1</strong>: The admin needs to have a <strong>personal account</strong> at the <strong>Australian Post</strong> website. For creating a new account click <strong><a href="https://auspost.com.au/mypost/auth/#/login" target="_blank" rel="noreferrer">here</a></strong>.</p><p><strong>Step 2</strong>: Now, to get the <strong>API key</strong> please click <strong><a href="https://developers.auspost.com.au/" target="_blank" rel="noreferrer">here</a></strong> and login using your account credentials. After login, you will see the below screen.<br><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2017/09/API-Key.png" target="_blank" rel="noreferrer"></a></p><p><strong>Step 3</strong>: Here, click on “<strong>Register now to get a PAC API Key</strong>” and you will be redirected to another page. Fill in the required information and click the <strong>submit</strong> button.<br><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2017/09/Enter-Details.png" target="_blank" rel="noreferrer"></a></p><p><a href="https://cdnblog.webkul.com/blog/wp-content/uploads/2017/09/Api-In-Email.png" target="_blank" rel="noreferrer"><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2017/09/Api-In-Email.png" alt="Api-Key-In-Email"></a></p><p><strong>Step 4</strong>: Lastly, check your email address provided in the previous step for the API key.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2017/09/Api-In-Email.png" alt="Api-Key-In-Email"></p><p>Now, fill all the details carefully and Save it.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/apidetails.webp" alt="Australia Post Configuration Admin"></p><p>This way, the Australia Post Shipping details are configured in the app. Let&#39;s Proceed to see how it works for the Sellers.</p><h3 id="seller-end" tabindex="-1">Seller End <a class="header-anchor" href="#seller-end" aria-label="Permalink to &quot;Seller End&quot;">​</a></h3><p>Once the admin enables the Australia Post Shipping, the same appears on the Seller side in the <strong>Shipping Configuration</strong> menu of the app.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/apseller.webp" alt="Dashboard Seller • Multivendor MarketPlace"></p><p>Now, the seller needs to visit the <strong>Shipping Configuration</strong> and enable Australia Post shipping from there.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/enablesellerside.webp" alt="Shipping Configuration Seller • Multivendor MarketPlace (1)"></p><p>This way, Australian Sellers can configure this shipping service.</p><p>Now, once an order is placed, the seller will get the option to fulfill via Australia Post shipping and generate the shipping label for the fulfilled orders.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/vieworder.webp" alt="Order Seller • Multivendor MarketPlace"></p><ul><li>Visit the <strong>Order Detail</strong> section and Scroll down to get the <strong>Fulfill</strong> button.</li><li>Click the <strong>Fulfill</strong> button and select the <strong>Shipping method</strong> as <strong>Australia Post</strong>.</li><li>Click the <strong>Fulfill</strong> <strong>Item</strong> button.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/04/Screenshot1-2.png" alt="fulfill -Multi-vendor Marketplace"></p><p>Clicking the Fulfill Item button, You will be asked to agree with the additional shipping method cost. Check the box and proceed to fulfill the order.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/04/Screenshot-7.png" alt="agree and fulfill -Multi-vendor Marketplace"></p><p>This way seller can fulfill the items.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/04/Order-Details-Seller-%E2%80%A2-Multivendor-MarketPlace.png" alt="Order Details Seller -Multi-vendor Marketplace"></p><p>Now, as soon as the seller fulfills the Order, he/she will get the option to generate Shipping label from the app as configured by the admin.</p><p>Furthermore, let&#39;s see how the seller can generate a shipping label in the app.</p><h3 id="shipping-label-generation" tabindex="-1">Shipping Label Generation <a class="header-anchor" href="#shipping-label-generation" aria-label="Permalink to &quot;Shipping Label Generation&quot;">​</a></h3><p>Both admin and seller can generate the shipping label for the fulfilled orders. Admin can configure the shipping Label details.</p><p>Seller needs to follow these steps to generate shipping labels:</p><ul><li>Login to Multi-vendor <strong>Seller</strong> <strong>Panel</strong>.</li><li>Go to <strong>Orders</strong>.</li><li>Visit the <strong>Order Listing</strong> section.</li><li>Select the <strong>Order</strong> for which You want to <strong>Generate Shipping Label.</strong></li><li>Further, click the <strong>View</strong> button in <strong>Action</strong> menu.</li><li>Click the Generate Shipping Label button.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/generateshiipinglabel.webp" alt="generate shipping label -Multi-vendor Australia Post"></p><h2 id="shipping-label-generation-1" tabindex="-1"><strong>Shipping Label Generation</strong> <a class="header-anchor" href="#shipping-label-generation-1" aria-label="Permalink to &quot;**Shipping Label Generation**&quot;">​</a></h2><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/04/Screenshot2-2.png" alt="shipping label generation -Multi-vendor Australia Post"></p><p>Once generated, the seller can print the shipping label from the Order detail section of the app.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/generateshiipinglabel.webp" alt="print shipping label -Multi-vendor Australia Post"></p><p>That&#39;s all about the Australia Post shipping Feature App.</p><h3 id="demo" tabindex="-1">Demo <a class="header-anchor" href="#demo" aria-label="Permalink to &quot;Demo&quot;">​</a></h3><p>Further, go through the below given link to check the demo of the Multi-vendor Marketplace App for Shopify:</p><p><a href="https://multivendor-marketplace-4.myshopify.com/pages/demo" target="_blank" rel="noreferrer">https://multivendor-marketplace-4.myshopify.com/pages/demo</a></p>',78)])])}const c=e(i,[["render",l]]);export{d as __pageData,c as default};
